window.bookSummaryJSON = "<p>Devon Sanders, a private investigator known for his efficiency and discretion, has never let a little rain stop him from solving a case. Unfortunately, the storm that is brewing in the paranormal world might just spell the end for Quintessence. </p> <p>When allies turn foe and trust becomes a commodity, Devon will have to use his instincts, detective skills, and friends to save not only the students of Quintessence, but the entire paranormal community. Amidst it all, he discovers that sacrificing what is most precious to him is a lot more than he bargained for. This time, the elementals are not on his side and Devon will learn that all magic comes at a price. </p> <p>Magic is elemental. </p>"; 
